<!DOCTYPE html>
<html data-color-mode="light">
  <head>
    <title>Render</title>
    <meta charset="utf-8">
    <meta name="referrer" content="never" />
    <script src="3d-0c821bd9d4ba9f613cef.min.js" type="text/javascript"></script><link rel="stylesheet" href="3d-0c821bd9d4ba9f613cef.css"/>
  </head>
  <body class="is-embedded">
  
    <div class="render-shell js-render-shell">
      
      <div class="js-render-bar render-bar render-bar-with-modes">
        <ul class="js-view-modes render-view-modes">
          <li data-mode="wireframe" class="js-view-mode-item">Wireframe</li>
          <li data-mode="normal" class="js-view-mode-item">Blocks</li>
          <li data-mode="solid" class="js-view-mode-item active">Smooth</li>
        </ul>
      </div>
      

      
      <div class="render-info">
        <div class="js-viewer-health render-health">
          <span class="symbol">&#8854;</span>
          <span class="js-message message"></span>
        </div>
      </div>
      

      <div id="solid-viewer" class="render-viewport" data-file="https://raw.githubusercontent.com/ayeinterns/ayeinterns-winter2021/main/sahaja/render/Spaceship_model.stl"></div>
      
    </div>

  </body>
</html>
